import React, {useState} from 'react'

export default function AddContact() {
    const [inputs, setInputs] = useState("")

    const handleChange = (event) => {
        const name = event.target.name;
        const value = event.target.value;
        setInputs(values => ({ ...values, [name]: value }))
    }

    const handleSubmit = (event) => {
        event.preventDefault();
        console.log(inputs);
       /* const val = {
            inputs.name,
            city,
        };*/
        //props.func(inputs);
        clearState();
    }
    const clearState = () => {
        setInputs('');
    };

  return (
    <div>
        <form onSubmit={handleSubmit}>
        <div class="form-group">
            <label for="exampleInputEmail1">Name:
                <input type="text" name='name' id="name" class="form-control" value={inputs.name || ""} onChange={handleChange} />
            </label>
         </div>
         <div class="form-group">   
            <label for="exampleInputEmail1">Contact:
                <input type="text" name='contact' id='contact' class="form-control" value={inputs.contact || ""} onChange={handleChange} />
            </label>
            </div>
            <div class="form-group">
            <label>
                <button type='submit' name='Contact' class="btn btn-primary">Enter</button>
            </label>
            </div>

        </form>
        </div>
  )
}
